package com.example.authentication_old.ScreenShot;

import lombok.extern.slf4j.Slf4j;

import java.util.Base64;

@Slf4j
public class ScreenShotTransfer {
    public final static String screenShot = "";

    public static byte[] screenShotTransfer(){
        return  Base64.getDecoder().decode(screenShot);
    }
}
